import React, { useState } from 'react'
import Data from './Data'
const Table = () => {
 
    const [user,setuser] = useState(Data)

  return (
    <div>
        <table>
            <tr>
                <th>Name</th>
                <th>Email</th>
                <th>Gender</th>
            </tr>
        {
            user.map((item)=>{
                return <tr key={item.id}>
                    <td> {item.name} </td>
                    <td> {item.email} </td>
                    <td> {item.gender} </td>
                </tr>
            })
        }
        </table>
    </div>
  )
}

export default Table
